component.image = {

	data: {
		image: '', //图片名称, 要先注册图片
		imageUrl: '',//图片的 url 地址
		sx: 0, //原图的偏移 x
		sy: 0,//原图的偏移 y
		sWidth: undefined, //截取原图宽度, undefined 表示图片默认宽度
		sHeight: undefined,//截取原图高度, undefined 表示图片默认宽度
		dx: 0,//目标位置偏移
		dy: 0,//目标位置偏移
		dWidth: undefined,//目标贴图宽度 undefined 表示图片默认宽度
		dHeight: undefined,//目标贴图高度 undefined 表示图片默认宽度
	},
	init: function (viewContext, selfImage) {
		var shape = this;
		var data = shape.data;
		if (data.image) {
			if (hud.util.getImage(data.image)) {
				var imageInfo = hud.util.getImage(data.image);
				shape.w = imageInfo.w;
				shape.h = imageInfo.h;
			} else {
				console.error('image is not exist:' + data.image);
			}
		}
		if (data.imageUrl) {
			if (!hud.util.getImage(data.imageUrl)) {
				hud.util.registerImage(data.imageUrl, data.imageUrl, function (name, imageInfo) {
					shape.w = imageInfo.w;
					shape.h = imageInfo.h;
					shape.dirty = true;
					view.dirty();
				});
			}
		}
	},
	validate: function (g, shape, view) {
		var data = shape.data;
		if (data.imageUrl && !hud.util.getImage(data.imageUrl)) {
			hud.util.registerImage(data.imageUrl, data.imageUrl, function (name, imageInfo) {
				shape.w = shape.w || imageInfo.width;
				shape.h = shape.h || imageInfo.height;
				shape.dirty = true;
				view.dirty();
			});
		}
	},
	draw: function (g, shape, view) {
		var data = shape.data;
		var sx = data.sx, sy = data.sy, sWidth = data.sWidth, sHeight = data.sHeight, dx = data.dx, dy = data.dy, dWidth = data.dWidth, dHeight = data.dHeight;

		var imageAsset = hud.util.getImage(data.image);
		if (!imageAsset) {
			imageAsset = hud.util.getImage(data.imageUrl);
		}
		if (!imageAsset) {
			return;
		}
		if (sWidth === undefined) {
			sWidth = imageAsset.w;
		}
		if (sHeight === undefined) {
			sHeight = imageAsset.h;
		}
		if (dWidth === undefined) {
			dWidth = imageAsset.w;
		}
		if (dHeight === undefined) {
			dHeight = imageAsset.h;
		}
		g.drawImage(imageAsset.source, sx, sy, sWidth, sHeight, dx, dy, dWidth, dHeight);
	}
}
