/**
 * 增加有标卡尺
 */
component.slide.gauge = {
	w: 220,
	h: 20,
	origin: {
		x: 0,
		y: 0,
	},
	defaultValue: {
		width: 200, //宽度
		value: 1.2, //当前值
		min: 0, //最小值
		max: 5, //最大值
		color: 'rgba(0, 233, 247, 1)', //颜色
		markOffsetY: 5, //底下三角形最顶端距离标尺的距离
		markSize: 11,//底下三角形边长
		markLineLength: 10,//标尺线的长度(最高的高度, 后续每个梯度降低 50%)
		markLineWidth: 1.5,//标尺线的宽度
		intervals: [1, 0.5, 0.16666666666666667],//标尺线, 3个梯度
	},
	draw: function (g, shape, view) {

		var markSize = shape.markSize;
		var color = shape.color;
		var width = shape.width;
		var range = shape.max - shape.min;
		var markLineLength = shape.markLineLength;
		var intervals = shape.intervals;
		g.strokeStyle = color;
		g.lineWidth = shape.markLineWidth;
		for (var i = 0; i < shape.intervals.length; i++) {
			var interval = shape.intervals[i];
			for (var j = 0; j <= range; j += interval) {

				var skip = false;
				for (var k = 0; k < i; k++) {
					var it = j / shape.intervals[k];
					if (Number.isInteger(it)) {
						skip = true;
						break;
					}
				}
				if (!skip) {
					var x = j / range * width;
					g.beginPath();
					g.moveTo(x, 0);
					g.lineTo(x, -markLineLength);
					g.stroke();
				}
			}
			markLineLength *= 0.5
		}

		var percent = (shape.value - shape.min) / range;
		var x = percent * width;
		var off = shape.markOffsetY;
		var h = markSize * 0.85;
		var w = markSize * 0.5
		g.beginPath();
		g.moveTo(x, off);
		g.lineTo(x + w, off + h);
		g.lineTo(x - w, off + h);
		g.closePath();
		g.fillStyle = color;
		g.fill();

	}
}

hud.util.registerImage('slide.gauge', component.slide.gauge);

component.fps = {
	w: 320,
	h: 30,
	attrs: {
		text: '',
		size: '26px',
	},
	init: function (view, image) { //scope 是 shape 对象
		var self = this;
		this._easyDraw = view;
		this.start();
	},
	methods: {
		start: function () {
			var self = this;
			var view = this._easyDraw;
			var lastTime = hud.util.currentMilliseconds(), dis = 0;
			this.calcTimerId = hud.util.setInterval(function () {
				var t = hud.util.currentMilliseconds();
				dis = t - lastTime;
				lastTime = t;
				var c = view._drawCount;
				var fps = Math.round(c * 1000 / dis);
				var tpf = Math.round((view._drawTime) / c) || 1;
				view.fps = fps;
				view.tpf = tpf;
				self.text = 'FPS: ' + fps + ' TPF: ' + tpf;
				view._drawCount = 0;
				view._drawTime = 0;
				self.dirty = true;
			}, 1000)
		},
		stop: function () {
			hud.util.clearInterval(this.calcTimerId);
		}

	},
	name: 'pirulen-text',
}


hud.util.registerImage('fps', component.fps)

component.parallelogram = {
	defaultValue: {
		width: 2,
		height: 15,
		skewAngle: 25,
		color: 'red',
		rotateAngle: 0,
	},
	draw: function (g, shape, view) {
		var width = shape.width, height = shape.height, skewAngle = shape.skewAngle,
			rotateAngle = shape.rotateAngle;
		g.save();
		g.beginPath();
		g.fillStyle = shape.color;
		// console.log(shape.color);
		g.rotate(rotateAngle / 180 * Math.PI);
		g.transform(1, 0, -Math.tan(Math.PI / 180 * skewAngle), 1, 0, 0);
		g.rect(-width / 2, -height / 2, width, height);
		g.fill();
		g.closePath();
		g.restore();
	}

};

