hud.util.registerImage('hexagonal', {
	defaultValue: {
		radius: 10,
		lineColor: "rgba(53,92,139,1.0)",
		fillColor: "rgba(53,92,139,.3)",
		text: "A",
		textColor: "rgba(38,156,252,1.0)",
		gradientPercent: 0.3,
		gradientAngle: 0
	},
	draw: function (g, shape, view) {
		g.save();
		var angle = 0, radius = shape.radius;
		g.beginPath();
		for (var i = 0; i < 6; i++) {
			var x = radius * Math.cos(angle), y = radius * Math.sin(angle);
			if (i == 0) {
				g.moveTo(x, y)
			} else {
				g.lineTo(x, y);
			}
			angle += Math.PI / 3;
		}
		var gradient;
		if (shape.gradientAngle !== undefined) {
			var ang = shape.gradientAngle;
			var startX = radius * Math.cos(ang), startY = radius * Math.sin(ang);
			var endX = radius * Math.cos(ang + Math.PI), endY = radius * Math.sin(ang + Math.PI);
			gradient = g.createLinearGradient(startX, startY, endX, endY);

			gradient.addColorStop(0, "white");
			if (shape.gradientPercent && shape.gradientPercent != 1) {
				gradient.addColorStop(shape.gradientPercent, shape.lineColor);
			}
			gradient.addColorStop(1, shape.lineColor);
		}

		g.closePath();
		g.strokeStyle = shape.gradientAngle !== undefined ? gradient : shape.lineColor;
		g.stroke();
		g.fillStyle = shape.fillColor;
		g.fill();

		view.drawImage(g, {
			name: "pirulen-text",
		}, {
				text: shape.text,
				color: shape.textColor,
			});

		g.restore();
	}
});

