hud.util.registerImage('lineChart', {
	w: 100,
	h: 100,
	defaultValue: {
		datas: [],
		showGrid: true,
		focusIndex: -1,
		scale: 2,
		rotateAngle: 0,
		lineColor: "rgba(33,153,123,1)",
		startAreaColor: "rgba(33,153,123,0.2)",
		endAreaColor: "rgba(33,153,123,0.0)",
	},
	draw: function (g, shape, view) {
		g.save();
		//g.setTransform(1, 0, 0, 1, 0, 0);
		var datas = shape.datas;
		var minY = Number.MAX_VALUE, maxY = Number.MIN_VALUE, minX = Number.MAX_VALUE, maxX = Number.MIN_VALUE;
		var scale = shape.scale, focusIndex = shape.focusIndex;
		var focusIndex = shape.focusIndex;
		var len = datas.length, focusX, focusY;
		for (var i = 0; i < len; i++) {
			var data = datas[i];
			var x = data.x * scale, y = data.y * scale;
			minY = Math.min(minY, y);
			maxY = Math.max(maxY, y);
			minX = Math.min(minX, x);
			maxX = Math.max(maxX, x);
			if (i == focusIndex) {
				focusX = x;
				focusY = y;
			}
		}
		var centerX = 0;
		if (shape.rotateAngle) {
			centerX = (minX + maxX) / 2;
			// g.translate(-centerX,0);
			// g.translate(centerX,0);
			g.rotate(shape.rotateAngle);
		}

		//背景网格
		if (shape.showGrid) {
			g.save();
			g.beginPath();
			for (var i = 0; i < len; i++) {
				var data = datas[i];
				var x = data.x * scale, y = data.y * scale;
				x -= centerX;
				if (i == 0) {
					g.moveTo(x, 0)
					g.lineTo(x, -y);
				} if (i == len - 1) {
					g.lineTo(x, -y);
					g.lineTo(x, 0);
				} else {
					g.lineTo(x, -y);
				}
			}
			g.closePath();
			g.clip();
			g.strokeStyle = shape.lineColor.colorRgba(0.2);
			for (var i = -maxX; i <= maxX; i += 5) {

				if (i % 20) {
					g.lineWidth = 1;
				} else {
					g.lineWidth = 2;
				}
				g.beginPath();
				g.moveTo(i, 0);
				g.lineTo(i, -maxY);
				g.stroke();
			}
			for (var i = 0; i <= maxY; i += 5) {

				if (i % 20) {
					g.lineWidth = 1;
				} else {
					g.lineWidth = 2;
				}
				g.beginPath();
				g.moveTo(-maxX, -i);
				g.lineTo(maxX, -i);
				g.stroke();
			}
			g.restore();
		}

		//线条
		g.beginPath();

		for (var i = 0; i < len; i++) {
			var data = datas[i];
			var x = data.x * scale, y = data.y * scale;
			x -= centerX;
			if (i == 0) {
				g.moveTo(x, -y);
			} else {
				g.lineTo(x, -y);
			}

		}

		g.strokeStyle = shape.lineColor;
		g.stroke();

		if (focusX != null && focusX != null) {
			// view.drawImage(g,{
			// 	name:'radio',
			// 	x:focusX - centerX,
			// 	y:focusY
			// },{
			// innerColor:shape.lineColor,
			//       outColor:shape.startAreaColor,
			// });


		}

		//阴影
		var gradient = g.createLinearGradient(minX, -maxY, minX, 0);
		gradient.addColorStop(0, shape.startAreaColor);
		gradient.addColorStop(1, shape.endAreaColor);
		g.beginPath();
		for (var i = 0; i < len; i++) {
			var data = datas[i];
			var x = data.x * scale, y = data.y * scale;
			x -= centerX;
			if (i == 0) {
				g.moveTo(x, 0)
				g.lineTo(x, -y);
			} if (i == len - 1) {
				g.lineTo(x, -y);
				g.lineTo(x, 0);
			} else {
				g.lineTo(x, -y);
			}
		}
		g.fillStyle = gradient;
		g.fill();
		if (shape.rotateAngle) {
			g.translate(-centerX, 0);
		}
		g.restore();

	},
});

