var chart = component.chart;
chart.pie = {
    w: 70,
    h: 110,
    origin: {
        x: 0.5,
        y: 0.5,
    },
    defaultValue: {
        r0: 20, //内圈
        r1: 23, //扇形内圈
        r2: 31, //扇形外圈
        r3: 34, //扇形外圆圈
        r4: 37.5, //最外层圆圈

        c0: 0.9, //里面文字
        c1: 0.9, //内圈
        c2: 0.3, //扇形背景
        c3: 0.9, //扇形色块
        c4: 0.5, //扇形外框
        c5: 0.2, //最外框
        c6: 0.9, //地下文字
        padding: 0.06, //扇形间隔
        color: 'rgb(31, 171, 246)', //
        value: 50,
    },
    draw: function (g, shape) {
        g.save();

        //里面的数字
        g.save();
        g.fillStyle = shape.color.colorRgba(shape.c0);
        g.textAlign = 'center';
        g.textBaseline = 'middle';
        g.font = '14px Arial Regular';
        g.fillText(shape.value.toFixed(0) + '%', 0, 0);
        g.restore();

        //最里面的一圈
        g.save();
        g.beginPath();
        g.strokeStyle = shape.color.colorRgba(shape.c1);
        g.arc(0, 0, shape.r0, 0, Math.PI * 2);
        g.stroke();
        g.restore();

        //扇形区
        g.save();
        g.rotate(Math.PI);
        var a = Math.PI * 2 / 12;
        var b = shape.padding;
        var c = a - b;
        var count = Math.round(shape.value * 12 / 100);
        g.fillStyle = shape.color.colorRgba(shape.c3);
        g.rotate(b / 2);
        for (var i = 0; i < 12; i++) {
            if (i >= count) {
                g.fillStyle = shape.color.colorRgba(shape.c2); //背景色
            }
            g.beginPath();
            g.ring(0, 0, shape.r1, shape.r2, 0, c); //x,y,innerRadius, outerRadius,startAngle,endAngle,anticlockwise
            g.closePath();
            g.fill();
            g.rotate(a);
        }
        g.restore();

        //扇形区外框
        g.save();
        g.beginPath();
        g.strokeStyle = shape.color.colorRgba(shape.c4);
        g.lineWidth = 1.8;
        g.arc(0, 0, shape.r3, 0, Math.PI * 2);
        g.stroke();
        g.restore();

        //最外面的边框
        g.save();
        g.beginPath();
        g.strokeStyle = shape.color.colorRgba(shape.c5);
        g.arc(0, 0, shape.r4, 0, Math.PI * 2);
        g.stroke();
        g.restore();

        //地下的数组
        g.save();
        g.fillStyle = shape.color.colorRgba(shape.c6);
        g.textAlign = 'center';
        g.textBaseline = 'top';
        g.font = '14px Pirulen';
        g.fillText(shape.label, 0, shape.r4 + 5);
        g.restore();

        g.restore();
    }
}

