hud.util.registerImage('chart-line-content', {

    defaultValue: {
        progress: 1,
        gridWidth: 198, //网格宽度
        gridHeight: 108, //网格高度
        xCount: 8, //x 方向网格个数 需要9个数据
        yCount: 10, //y 方向网格个数
        axisSplitWidth: 3, //y 轴上标尺的长度
        axisTextOffset: 4, //x 轴 y 轴上的 lable 距离坐标轴的偏移量
        axisColor: 'rgba(87, 95, 105, 0.8)', //坐标轴的颜色
        gridColor: 'rgba(0, 93, 166, 0.8)', //网格的颜色
        half: false, //默认是否从 50% 开始显示
        axisYLabels: ['', '20%', '40%', '60%', '80%', '100%'],
        axisYLabelsHalf: ['', '60%', '70%', '80%', '90%', '100%'],
        autoHalf: true, //是否自动从 50% 开始显示
        data: [
            { x: '1/31', y: 79, v: 799 },
            { x: '2/1', y: 79, v: 799 },
            { x: '2/2', y: 83, v: 833 },
            { x: '2/3', y: 85, v: 855 },
            { x: '2/4', y: 76, v: 766 },
            { x: '2/5', y: 76, v: 766 },
            { x: '2/6', y: 80, v: 800 },
            { x: '2/7', y: 93, v: 800 },
            { x: '2/8', y: 85, v: 855 }
        ],
    },

    draw: function (g, shape, view) {

        if (shape.autoHalf) {
            var data = shape.data || [];
            //如果最小值大于50%, 那么自动对半显示
            if (data.length > 0) {
                var minY = Number.MAX_SAFE_INTEGER;
                data.forEach(function (item) {
                    minY = Math.min(minY, item.y);
                })
                shape.half = minY >= 50;
            }
        }
        this.drawGrid(g, shape, view);
        this.drawAxisX(g, shape, view);
        this.drawAxisY(g, shape, view);
        this.drawSeries(g, shape, view);
    },
    drawSeries: function (g, shape, view) {

        var data = shape.data;
        if (data.length < 2) {
            return;
        }
        var linearGradient = g.createLinearGradient(0, shape.gridHeight / 2, shape.gridWidth, shape.gridHeight / 2);
        linearGradient.addColorStop(0, 'rgba(26, 180, 254, 0.5)');
        linearGradient.addColorStop(shape.progress, 'rgba(26, 180, 254, 0)');
        g.shadowColor = 'rgba(0, 0, 0, 0.1)';
        g.shadowBlur = 10;
        var dx = shape.ddxx;
        var dy = shape.ddyy;
        var off = shape.half ? 50 : 0;
        var limit = shape.half ? 50 : 100;
        g.beginPath();
        g.moveTo(0, shape.gridHeight);
        for (var i = 0; i < data.length; i++) {
            var y = shape.gridHeight * (limit - (data[i].y - off)) / limit
            g.lineTo(i * dx, y);
        }
        g.lineTo(shape.gridWidth, shape.gridHeight);
        g.closePath();
        g.fillStyle = linearGradient;
        g.fill();

    },
    drawAxisX: function (g, shape, view) {

        g.strokeStyle = shape.axisColor;
        g.lineWidth = 1;
        g.lineCap = "round";
        g.beginPath();
        g.moveTo(0, shape.gridHeight);
        g.lineTo(shape.gridWidth, shape.gridHeight);
        g.stroke();
        var data = shape.data;
        var off = shape.axisTextOffset;
        var dx = shape.ddxx;
        for (var i = 1; i < shape.xCount; i++) {
            var x = dx * i;
            if (i > data.length) {
                break;
            }
            g.drawText(data[i].x, x, shape.gridHeight + off, shape.axisColor, '16px 思源黑体', 'center', 'top'); //text, x, y, fillStyle, font, textAlign, textBaseline
        }
    },
    drawAxisY: function (g, shape, view) {
        g.strokeStyle = shape.axisColor;
        g.lineWidth = 1;
        g.lineCap = "round";
        g.beginPath();
        g.moveTo(0, 0);
        g.lineTo(0, shape.gridHeight);
        g.stroke();
        var data = shape.data;
        var off = shape.axisTextOffset;
        var dy = shape.ddyy;

        for (var i = 0; i < shape.yCount; i++) {
            var y = dy * i;
            g.beginPath();
            g.moveTo(0, y);
            g.lineTo(shape.axisSplitWidth, y);
            g.stroke();
        }
        var ts = shape.half ? shape.axisYLabelsHalf : shape.axisYLabels;
        shape.half
        for (var i = 2; i <= shape.yCount; i += 2) {
            var y = dy * i;
            if (i % 2 == 0) {
                g.drawText(ts[i / 2], 0 - off, shape.gridHeight - y, shape.axisColor, '16px 思源黑体', 'right', 'middle'); //text, x, y, fillStyle, font, textAlign, textBaseline
            }
        }
    },
    drawGrid: function (g, shape, view) {
        var dx = shape.ddxx = shape.gridWidth / shape.xCount;
        var dy = shape.ddyy = shape.gridHeight / shape.yCount;
        g.strokeStyle = shape.gridColor;
        g.lineWidth = 1;
        var x = y = 0;
        for (var i = 1; i < shape.xCount; i++) {
            x = dx * i;
            g.beginPath();
            g.moveTo(x, 0);
            g.lineTo(x, shape.gridHeight);

            g.stroke();
        }
        for (var i = 0; i < shape.yCount; i++) {
            y = dy * i;
            g.beginPath();
            g.moveTo(0, y);
            g.lineTo(shape.gridWidth, y);
            g.stroke();
        }
    },
})

