hud.util.registerImage('chart-gauge', {
    w: 180,
    h: 180,
    origin: {
        x: 0.5,
        y: 0.5,
    },
    defaultValue: {
        startAngle: 130 / 180 * Math.PI,
        endAngle: 410 / 180 * Math.PI,
        graduationCount: 50,
        graduationWidth: 3,
        graduationColor: 'rgb(0, 70, 132)',
        graduationMarkColor: 'rgb(0, 255, 255)',
        innerRadius: 60,
        outerRadius: 80,
        graduationLabelRaduis: 47,
        graduationMargin: 3,
        ringColor: 'rgb(0, 135, 255)',
        value: 0,

    },
    children: [{
        defaultValue: {
            size: '12px',
            color: '{graduationMarkColor}',
            text: '${title}'
        },
        name: 'pirulen-text',
        x: 0,
        y: 45,
    },
    {
        defaultValue: {
            size: '16px',
            color: '${graduationMarkColor}',
            text: '${valueStr}'
        },
        name: 'pirulen-text',
        x: 0,
        y: 65,
    }
    ],

    draw: function (g, shape, view) {

        g.save();
        g.beginPath();
        g.ring(0, 0, shape.innerRadius, shape.outerRadius, shape.startAngle, shape.endAngle);
        g.strokeStyle = shape.ringColor;
        g.stroke();

        var total = shape.endAngle - shape.startAngle;
        var a = total / (shape.graduationCount + 1);
        var c = Math.round(shape.value / 100 * shape.graduationCount);
        g.rotate(shape.startAngle);
        g.lineWidth = shape.graduationWidth;
        g.rotate(a);
        for (var i = 1; i <= shape.graduationCount; i++) {

            if (i <= c) {
                g.strokeStyle = shape.graduationMarkColor
            } else {
                g.strokeStyle = shape.graduationColor
            }

            g.beginPath();
            g.moveTo(shape.innerRadius + shape.graduationMargin, 0)
            g.lineTo(shape.outerRadius - shape.graduationMargin, 0);
            g.stroke();
            g.rotate(a);
        }
        g.restore();

        for (var i = 0; i <= shape.graduationCount; i++) {
            if (i % 10 == 0) {
                var ta = shape.startAngle + i * a;
                var x = Math.cos(ta) * shape.graduationLabelRaduis;
                var y = Math.sin(ta) * shape.graduationLabelRaduis;
                g.drawText(i * 2, x, y, shape.graduationColor, '10px NotoSansHans-Light', 'center')
            }
        }


        var pa = shape.startAngle + (total - a - a) * shape.value / 100 + a;

        shape.valueStr = shape.value.toFixed(2) + '%';
        view.drawImage(g, { name: 'chart-gauge-pointer', angle: pa }, shape)
    },
});

