/**
* name     lossChart
* path     cdsihan/lossChart.js
**/
hud.util.registerImage('lossChart', {
    w: 1230, //宽度
    h: 490, //高度
    origin: { //起始点位置，取值 0 到 1   (0,0) 左上角  (0.5, 0.5) 中心点  (1,1)右下角
        x: 60 / 1230,
        y: 1 - 30 / 490,
    },
    data: {
        cw: 1170, //宽度
        ch: 430, //高度
        chartAngle: Math.PI / 5,
        limit: 10,
        baseColor: 'rgba(5, 248, 238, 1)',
        bgColor: 'rgba(0, 180, 255, 1)',
        items: [
            {
                "label": "2013",
                "value": 5.92
            },
            {
                "label": "2014",
                "value": 6.53
            },
            {
                "label": "2015",
                "value": 4.89
            },
            {
                "label": "2016",
                "value": 7.02
            },
            {
                "label": "2017",
                "value": 5.31
            }
        ]
    },
    //实例 add 到容器后，容器调用 init 方法初始组件
    init: function (viewContext, selfImage) {
        var self = this;
        this.on('data.items.chart', function (e) {
            self.reset();
            self._axisX_fresh = false;
        })
        this.on('data.limit.chart', function () {
            self._axisY_fresh = false;
        })
    },
    //实例 remove 到容器后，容器调用 destroy 方法，销毁组件
    destroy: function (viewContext, selfImage) {
        //scope 是实例, viewContext 是绘图上下文， selfImage 就是自身
        this.off('data.items.chart');
    },
    methods: {
        reset: function () {
            var w = this.data.cw;
            var h = this.data.ch;
            var viewContext = this._viewContext;
            var items = this.data.items || [];
            this.children = this.children || [];
            var c = items.length - this.children.length;//比原来的多
            if (c > 0) {
                for (var i = 0; i < c; i++) {
                    var ins = this.createSeriesInstance();
                    ins._parent = this;
                    ins._parentHidden = !viewContext.isVisible(this);
                    viewContext.add(ins)
                }
            } else if (c < 0) {
                c *= -1;
                for (var i = 0; i < c; i++) {
                    var ins = this.children[0];
                    viewContext.remove(ins)
                    delete ins._parent;
                }
            }
            this.layout(viewContext, items, w, h);
        },
        layout: function (viewContext, items, w, h) {
            var self = this;
            //倾斜角度
            var chartAngle = self.data.chartAngle;
            //圆锥高度
            var imgAsset = hud.util.getImage('yuanzhui');
            //最后一个序列扣除的横向坐标
            var xx = (h - imgAsset.h) / Math.tan(chartAngle);
            //算出每个序列间距
            var len = w - xx;
            var dx = len / items.length;
            //设置序列位置 
            var sw = h / Math.tan(chartAngle);
            this.children.forEach(function (c, i) {
                c.x = (i + 1) * dx;
                c.y = 0;
                c.data.chartAngle = chartAngle;
                c.h = h;
                c.w = sw;
            })
            //计算最大值，格式化 5 的倍数
            if (items.length > 0) {
                var max = 0;
                items.forEach(function (row) {
                    max = Math.max(max, row.value);
                })
                max += 1;//保证比最大值大1，否则会超标坐标轴
                max = Math.ceil(max / 5) * 5;
                var dy = h / max;
                this.children.forEach(function (c, i) {
                    self.data.ii = 1;
                    c.data.limit = max;
                    c.data.dy = dy;
                    c.data.label = items[i].label;
                    c.data.value = items[i].value;
                })
                if (this.data.limit != max) {
                    this.data.limit = max;
                    this._axisY_fresh = false;
                }
            } else {
                this.data.limit = 10;
            }
            this.data.xLineLen = len;
            this.data.xDx = dx;
            this.dirty = true;//重绘
        },
        createSeriesInstance: function () { //创建一个序列
            return {
                x: 0,
                y: 0,
                name: 'lossChart-item-series',
                data: {},
                interact: true,
                clip: true,
                // draggable: true,
                margin: 100,
            }
        },
        getAxisXLabel: function (v) {
            return v;
        },
        getAxisYLabel: function (v) {
            return v.toFixed(0) + '%';
        }
    },
    draw: function (g, shape, viewContext) {
        if (!shape._inited) {
            shape._inited = true;
            shape.reset();
        }
        // if (!shape._axisY_fresh) {
        //     shape._axisY_fresh = true;
            this.drawAxisY(g, shape, viewContext);
        // }
        // if (!shape._axisX_fresh) {
        //     shape._axisX_fresh = true;
            this.drawAxisX(g, shape, viewContext);
        // }
    },
    drawAxisY: function (g, shape, view) {
        var data = shape.data;
        var count = data.items.length;
        var bgColor = shape.data.bgColor;
        //倾斜角度
        var chartAngle = this.data.chartAngle;
        var xx = data.ch / Math.tan(chartAngle);
        var yy = data.ch;
        var lineLen = data.xLineLen;
 
        //轴线
        var gradient = g.createLinearGradient(0, 0, xx, -yy);
        gradient.addColorStop(0, bgColor);
        gradient.addColorStop(1, bgColor.colorRgba(0.3));
        g.lineWidth = 2;
        g.beginPath();
        g.moveTo(0, 0);
        g.lineTo(xx, -yy);
        g.strokeStyle = gradient;
        g.stroke();
 
        //标签和横线
        var dx = xx / data.limit;
        var dy = yy / data.limit;
        var da = 0.8 / data.limit;//颜色渐变，最小值 0.3
        g.lineWidth = 1;
        g.strokeStyle = bgColor.colorRgba(0.3);
        for (var i = 0; i <= data.limit; i++) {
            //颜色渐变
            g.drawText(shape.getAxisYLabel(i), dx * i - 20, -dy * i, bgColor.colorRgba(1 - i * da), "30px pirulen", "right", "middle");
            g.beginPath();
            g.moveTo(dx * i, -dy * i);
            g.lineTo(dx * i + lineLen, -dy * i);
            g.stroke();
        }
 
    },
    drawAxisX: function (g, shape, view) {
        var data = shape.data;
        var bgColor = data.bgColor;
        var items = data.items;
        var xDx = data.xDx;
        items.forEach(function (row, i) {
            g.drawText(shape.getAxisXLabel(row.label), (i + 1) * xDx, 10, bgColor, "30px pirulen", "center", "top");
        })
    }
})
 
hud.util.registerImage('lossChart-item-series', {
    w: 430, //宽度
    h: 430, //高度
    origin: { //起始点位置，取值 0 到 1   (0,0) 左上角  (0.5, 0.5) 中心点  (1,1)右下角
        x: 0,
        y: 1,
    },
    data: {
        chartAngle: Math.PI / 5,
        value: 5.92,
        label: '',
        limit: 10,
        baseColor: 'rgba(5, 248, 238, 1)',
        bgColor: 'rgba(0, 180, 255, 1)',
        percent: 1
    },
    draw: function (g, shape, viewContext) {
        var data = shape.data;
        var chartAngle = data.chartAngle;
        var value = data.value;
        var limit = data.limit;
        var baseColor = data.baseColor;
        var bgColor = data.bgColor;
        var percent = data.percent;
 
        var imgAsset = hud.util.getImage('yuanzhui');
 
 
        var len = Math.sqrt(Math.pow(shape.w, 2) + Math.pow(shape.h, 2));
        len *= percent;
        len *= value / limit;
 
        //圆锥地下点坐标
        var p0 = { x: Math.cos(chartAngle) * len, y: -Math.sin(chartAngle) * len };
        //圆锥上面点坐标
        var p1 = { x: p0.x - 1, y: p0.y - imgAsset.h + 2 };//图片的尺寸相差2个像素
        //边框
        g.lineCap = "round";
        var gradient = g.createLinearGradient(0, 0, p0.x, p0.y);
        gradient.addColorStop(0, bgColor);
        gradient.addColorStop(1, baseColor);
        g.strokeStyle = gradient;
        g.lineWidth = 1;
        g.beginPath();
        g.moveTo(0, 0);
        g.lineTo(p0.x, p0.y);
        g.stroke();
        var gradient = g.createLinearGradient(0, 0, p1.x, p1.y);
        gradient.addColorStop(0, bgColor);
        gradient.addColorStop(1, baseColor);
        g.moveTo(0, 0);
        g.lineTo(p1.x, p1.y);
        g.stroke();
        g.drawImage(imgAsset.source, p1.x - imgAsset.w / 2, p1.y - 1)
 
        //阴影
        g.save();
        g.beginPath();
        g.moveTo(0, 0);
        g.lineTo(p0.x, p0.y);
        g.lineTo(p1.x, p1.y);
        g.closePath();
        g.clip();
        g.fillStyle = bgColor.colorRgba(0.23);
        g.fillRect(0, 0, shape.w, -shape.h);
        g.beginPath();
        for (var i = 0; i < shape.w; i = i + 4) {
            g.moveTo(i, 0);
            g.lineTo(i, -shape.h);
        }
        g.strokeStyle = baseColor.colorRgba(0.2);
        g.lineWidth = 2;
        g.stroke();
        g.restore();
 
        //右边文字标签
        g.drawText(value.toFixed(2) + "%", p0.x + 20, (p0.y + p1.y) / 2, baseColor, "26px pirulen", "left", "middle");
    }
})


