hud.util.registerImage('station_base_info_line', {
    data: {
        fromId: '',
        toId: '',
        x0: 0,
        y0: 0, //
        x1: 0, //
        y1: 0,//
        x2: 0,
        y2: 0,
        fromOffsetX: 0,
        fromOffsetY: 0,
        toOffsetX: 0,
        toOffsetY: 0,
        width: 2,
        color: 'rgba(0, 255, 255, 1)',
        type: 'straight',
        pointOffset: 20,
        circle: true
    },
    draw: function (g, shape, view) {
        var data = shape.data;
        var x0 = data.x0;
        var y0 = data.y0;
        var x1 = data.x1;
        var y1 = data.y1;
        if (data.fromId && view.allShapeMap[data.fromId]) {
            var s = view.allShapeMap[data.fromId];
            var pos = view.getShapePosition(s);
            x0 = pos.x;
            y0 = pos.y;
        }
        if (data.toId && view.allShapeMap[data.toId]) {
            var s = view.allShapeMap[data.toId];
            var pos = view.getShapePosition(s);
            x1 = pos.x;
            y1 = pos.y;
        }
        x0 += data.fromOffsetX;
        y0 += data.fromOffsetY;
        x1 += data.toOffsetX;
        y1 += data.toOffsetY;
        if (data.type == 'straight') {
            g.beginPath();
            g.moveTo(x0, y0);
            g.lineTo(x1, y1);
        } else if (data.type == 'h-v') {
            g.beginPath();
            g.moveTo(x0, y0);
            g.lineTo(x1, y0);
            g.lineTo(x1, y1);
        } else if (data.type == 'v-h') {
            g.beginPath();
            g.moveTo(x0, y0);
            g.lineTo(x0, y1);
            g.lineTo(x1, y1);
        } else if (data.type == 'h-z') {
            var po = data.pointOffset, greater = x1 > x0, tx = greater ? x0 + po : x0 - po;
            g.beginPath();
            g.moveTo(x0, y0);
            g.lineTo(tx, y0);
            g.lineTo(tx, y1);
            g.lineTo(x1, y1);
        } else if (data.type == 'v-z') {
            var po = data.pointOffset, greater = y1 > y0, ty = greater ? y0 + po : y0 - po;
            g.beginPath();
            g.moveTo(x0, y0);
            g.lineTo(x0, ty);
            g.lineTo(x1, ty);
            g.lineTo(x1, y1);
        } else if (data.type == 'h-b-z') {
            var po = data.pointOffset, greater = x1 > x0, tx = greater ? x0 - po : x0 + po;
            g.beginPath();
            g.moveTo(x0, y0);
            g.lineTo(tx, y0);
            g.lineTo(tx, y1);
            g.lineTo(x1, y1);
        } else if (data.type == 'v-b-z') {
            var po = data.pointOffset, greater = y1 > y0, ty = greater ? y0 - po : y0 + po;
            g.beginPath();
            g.moveTo(x0, y0);
            g.lineTo(x0, ty);
            g.lineTo(x1, ty);
            g.lineTo(x1, y1);
        } else if (data.type == 'extend.y') {
            var po = data.pointOffset, greater = y1 > y0, ty = greater ? po : -po;
            g.beginPath();
            g.moveTo(x0, y0);
            g.lineTo(x0, y1 + ty);
            g.lineTo(x1, y1 + ty);
            g.lineTo(x1, y1);
        }
        if (data.circle) {
            g.arc(x1, y1, 3, 0, 2 * Math.PI);
        }
        if (data.x2 && data.y2) {
            g.lineTo(data.x2, data.y2);
        }
        g.lineWidth = data.width;
        g.strokeStyle = data.color;
        g.stroke();
    }
})


