hud.util.registerImage('energyMeter_state', {
    margin: 0,
    data: {
        items: [],
        fillColor: 'rgba(0, 180, 255, 1)' //整体扇形图填充色
    },
    init: function (viewContext, selfImage) {
        var self = this;
        if (!selfImage.index) {
            selfImage.index = 1;
        } else {
            selfImage.index++;
        }

        this.typeName = selfImage.index;
        this.on('data.items.chart', function (e) {
            self.reset();
        });

        self.animation();
    },

    destroy: function (viewContext, selfImage) {
        this.off('data.items.chart');
        viewContext.off('m.' + this.typeName + '.*.mouseenter.a');
        viewContext.off('m.' + this.typeName + '.*.mouseleave.a');
    },
    methods: {
        reset: function () {
            var self = this;
            var viewContext = this._viewContext;
            var items = this.data.items || [];
            this.children = this.children || [];
            var c = items.length - this.children.length;
            if (c > 0) {
                for (var i = 0; i < c; i++) {
                    var ins = this.createSeriesInstance();
                    ins._parent = this;
                    viewContext.add(ins)
                }
            } else if (c < 0) {
                c *= -1;
                for (var i = 0; i < c; i++) {
                    var ins = this.children[0];
                    viewContext.remove(ins)
                    delete ins._parent;
                }
            }
            items.sort(function (a, b) {
                return a.count - b.count
            });
            var total = 0;
            for (var i = 0; i < items.length; i++) {
                total += items[i].count;
            }
            for (var j = 0; j < items.length; j++) {
                items[j].radius = 100 / items[items.length - 1].count * items[j].count + 100;
                items[j].angle = Math.PI / 6 + (Math.PI * 2 - Math.PI / 6 * items.length) / total * items[j].count;
                if (j == 0) {
                    items[j].rotation = -Math.PI / 4;
                } else {
                    items[j].rotation = items[j - 1].rotation + items[j - 1].angle;
                }
            }

            this.children.forEach(function (c, i) {
                c.type = self.typeName;

                c.data.count = items[i].count;
                c.data.status = items[i].status;
                c.data.angle = items[i].angle;
                c.data.radius = items[i].radius;
                c.data.rotation = items[i].rotation;

                var colorAlpha = (0.8 - 0.4) / (items.length - 1) * i + 0.4;
                c.data.itemColor = self.data.fillColor.colorRgba(colorAlpha);
            });
            this.dirty = true;
        },
        createSeriesInstance: function () { //创建一个序列
            return {
                name: "pie_chart_item",
                x: 0,
                y: 0,
                interact: true,
                clip: true,
                data: {},
                rotate: 0,
                type: ''
            }
        },
        animation: function () {
            var self = this;
            var viewContext = this._viewContext;
            viewContext.on('m.' + self.typeName + '.*.mouseenter.a', function (e) {
                var s = e.originSource;
                if (self.ani) {
                    self.ani.stop();
                }
                self.ani = hud.util.animate({
                    play: true,
                    target: s,
                    data: true,
                    prop: 'percent',
                    from: 0.9,
                    to: 1,
                    easing: 'elasticOut',
                    dur: 500,
                })
            })
            viewContext.on('m.' + self.typeName + '.*.mouseleave.a', function (e) {
                var s = e.originSource;
                if (self.ani) {
                    self.ani.stop();
                }
                self.ani = hud.util.animate({
                    play: true,
                    target: s,
                    data: true,
                    prop: 'percent',
                    from: 1,
                    to: 0.9,
                    easing: 'elasticOut',
                    dur: 500,
                })
            })
        }
    },
    draw: function (g, shape, viewContext) {
        if (!shape._inited) {
            shape._inited = true;
            shape.reset();
        }
    }
});

